const ShowLoginError = ({children}) => {
    return (
        <div className=" bg-light border border-danger rounded-5 text-danger text-center p-1 fs-6">
            <i class="bi bi-exclamation-diamond-fill me-2 fs-5"></i>
            {children}
        </div>
    )
}

export default ShowLoginError
